import React from 'react';
import '../resources/css/custom.css'
import { Container, Col, Row, Navbar} from 'react-bootstrap';
import Sidebar from '../components/Sidebar';
const ContentCard = (props) => {
    return (
        <div className="cards">
            <p>{props.data}</p>
        </div>
    )
}
const Home = () => {

    const MainSection = (props) => {
        return (
            <div>
                <Container>
                <h4 className="custom-font">เรื่องเล่าล่าสุด</h4>
                <Row>
                    <Col className='no-margin' style="height:100;">
                        <ContentCard data="Card1" />
                    </Col>
                    <Col className='no-margin'>
                        <Row>
                            <Col lg={6}>
                                <ContentCard data="Card2" />
                            </Col>
                            <Col lg={6}>
                                <ContentCard data="Card3" />
                            </Col>
                            <Col lg={6}>
                                <ContentCard data="Card4" />
                            </Col>
                            <Col lg={6}>
                                <ContentCard data="Card5" />
                            </Col>
                        </Row>
                    </Col>
                </Row>
                </Container>



            </div>
        )
    }
    return (
        <div>
            <Navbar>
                    <a href="/">
                        <img className='logo' src={require('../resources/img/dearToday.PNG')} />
                    </a>

            </Navbar>

                <Row>
                    <Col className='d-none d-sm-block no-right-padding' lg={2} sm={3}><Sidebar/></Col>

                    <Col className='no-left-padding' lg={10} sm={9} ><MainSection /></Col>

                </Row>
        </div>
    );
};

export default Home;
